めちゃくちゃ大きいって言われてた﻿
台風９号のあとに﻿
﻿
最大瞬間風速85メートルの﻿
過去最強クラスの台風10号が🌪🌀﻿
﻿
気候変動待ったなし！！﻿
﻿
ヤバいって言語力ないけど﻿
ヤバいしか出てこない😅﻿
﻿
﻿
最強台風に﻿
お気をつけください🙏﻿
﻿
﻿
そして話は変わるけど﻿
最近思うことについて長いけど書いたよ﻿
⇩⇩⇩﻿
