【お金よりも大切なモノ】﻿
﻿
沖縄は、観光業やサービス業が盛んだが﻿
例の感染症によって、﻿
それらの在り方を見直すきっかけになり﻿
良い意味で捉えると﻿
絶好のタイミングが訪れた﻿
﻿
﻿
沖縄は、これまでひたすら﻿
観光業やサービス業に力を入れてきたが﻿
自然は年々破壊され、﻿
沖縄の貧困率も改善されず﻿
変わらないままだ﻿
﻿
﻿
そんななか未だに﻿
恩納村や、糸満市では、﻿
土地、ビーチを開拓し﻿
新しい大きなホテルを建設している﻿
﻿
﻿
今のままでは﻿
自然は破壊され続け﻿
わたしたちの暮らしも豊かには﻿
絶対にならない﻿
﻿
﻿
自然は人の信頼と同じように﻿
壊すのは簡単だが﻿
元に戻るまで時間がかかるし、﻿
気付いた時には﻿
もう遅いかもしれない﻿
﻿
﻿
しかし﻿
﻿
まだ間に合う﻿
﻿
﻿
だからこそ﻿
わたしは声をあげ続けるし﻿
行動し続ける﻿
﻿
﻿
まだ小さな波しか起こせないかもしれないが﻿
必ず大きな波を起こし﻿
﻿
お金より大切なモノ﻿
かけがえのない美ら島を﻿
あなたと共に﻿
永遠に残していきたい😌🌊🌴🌍🌺🕊﻿
