A Modern & Chic Outdoor wedding at the historic Casa Blanca Museum in the heart of Old San Juan, Puerto Rico.

Paula + Eduardo are such an elegant couple with a unique modern taste in decor and style. This was a marvelous outdoor wedding at the historic Casa Blanca Museum in the heart of Old San Juan, Puerto Rico. The couple chose this charming venue and turned it into a non-traditional for their afternoon ceremony and reception. The main place for the reception was a long horizontal fountain which at the end was accompanied by two other renascence fountains. Incredibly a lot of green and white accents. It was filled with eclectic cream and white decor and had an overall charming vibe along with a festive environment.

